.sapMDialogParent {
  position: fixed;
  left: 0;
  right: 0;
  top: 0;
  bottom: 0;
  display: flex;
  justify-content: center;
  align-items: center;
}
.sapMDialog {
  display: flex;
  flex-direction: column;
}
.sapMDialogSection {
  flex-grow: 1;
  display: flex;
}
.sapMDialog.sapMDialogStretched {
  top: 5%;
  bottom: 5%;
  left: 3.5%;
  right: 3.5%;
  min-width: 0;
  min-height: 0;
}
.sap-phone .sapMDialog.sapMDialogStretched {
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  box-shadow: none;
  border-radius: 0;
}
